	'messages:apihelp-paraminfo-example-1' => 'en:Show info for <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, and <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.',
	'messages:apihelp-paraminfo-example-2' => 'en:Show info for all submodules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.',
	'messages:apihelp-parse-summary' => 'en:Parses content and returns parser output.',
	'messages:apihelp-parse-extended-description' => 'en:See the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.

