	'messages:config-profile-private' => 'en:Private wiki',
	'messages:config-profile-help' => 'en:Wikis work best when you let as many people edit them as possible.
In MediaWiki, it is easy to review the recent changes, and to revert any damage that is done by naive or malicious users.

However, many have found MediaWiki to be useful in a wide variety of roles, and sometimes it is not easy to convince everyone of the benefits of the wiki way.
So you have the choice.

The <strong>{{int:config-profile-wiki}}</strong> model allows anyone to edit, without even logging in.
A wiki with <strong>{{int:config-profile-no-anon}}</strong> provides extra accountability, but may deter casual contributors.

The <strong>{{int:config-profile-fishbowl}}</strong> scenario allows approved users to edit, but the public can view the pages, including history.
A <strong>{{int:config-profile-private}}</strong> only allows approved users to view pages, with the same group allowed to edit.

More complex user rights configurations are available after installation, see the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:User_rights relevant manual entry].',
	'messages:config-license' => 'en:Copyright and license:',
	'messages:config-license-none' => 'en:No license footer',
	'messages:config-license-cc-by-sa' => 'en:Creative Commons Attribution-ShareAlike',
	'messages:config-license-cc-by' => 'en:Creative Commons Attribution',
	'messages:config-license-cc-by-nc-sa' => 'en:Creative Commons Attribution-NonCommercial-ShareAlike',
	'messages:config-license-cc-0' => 'en:Creative Commons Zero (Public Domain)',
	'messages:config-license-gfdl' => 'en:GNU Free Documentation License 1.3 or later',
	'messages:config-license-pd' => 'en:Public Domain',
	'messages:config-license-help' => 'en:Many public wikis put all contributions under a [https://freedomdefined.org/Definition free license].
This helps to create a sense of community ownership and encourages long-term contribution.
It is not generally necessary for a private or corporate wiki.

If you want to be able to use text from Wikipedia, and you want Wikipedia to be able to accept text copied from your wiki, you should choose <strong>{{int:config-license-cc-by-sa}}</strong>.

Wikipedia previously used the GNU Free Documentation License.
The GFDL is a valid license, but it is difficult to understand.
It is also difficult to reuse content licensed under the GFDL.',
	'messages:config-email-settings' => 'en:Email settings',
	'messages:config-enable-email' => 'en:Enable outbound email',
	'messages:config-enable-email-help' => 'en:If you want email to work, [https://www.php.net/manual/en/mail.configuration.php PHP\'s mail settings] need to be configured correctly.
If you do not want any email features, you can disable them here.',
	'messages:config-email-user' => 'en:Enable user-to-user email',
	'messages:config-email-user-help' => 'en:Allow all users to send each other email if they have enabled it in their preferences.',
	'messages:config-email-usertalk' => 'en:Enable user talk page notification',
	'messages:config-email-usertalk-help' => 'en:Allow users to receive notifications on user talk page changes, if they have enabled it in their preferences.',
	'messages:config-email-watchlist' => 'en:Enable watchlist notification',
	'messages:config-email-watchlist-help' => 'en:Allow users to receive notifications about their watched pages if they have enabled it in their preferences.',
	'messages:config-email-auth' => 'en:Enable email authentication',
	'messages:config-email-auth-help' => 'en:If this option is enabled, users have to confirm their email address using a link sent to them whenever they set or change it.
Only authenticated email addresses can receive emails from other users or change notification emails.
Setting this option is <strong>recommended</strong> for public wikis because of potential abuse of the email features.',
	'messages:config-email-sender' => 'en:Return email address:',
	'messages:config-email-sender-help' => 'en:Enter the email address to use as the return address on outbound email.
This is where bounces will be sent.
Many mail servers require at least the domain name part to be valid.',
	'messages:config-upload-settings' => 'en:Images and file uploads',
	'messages:config-upload-enable' => 'en:Enable file uploads',
	'messages:config-upload-help' => 'en:File uploads potentially expose your server to security risks.
For more information, read the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security security section] in the manual.

To enable file uploads, change the mode on the <code>images</code> subdirectory under MediaWiki\'s root directory so that the web server can write to it.
Then enable this option.',
	'messages:config-upload-deleted' => 'en:Directory for deleted files:',
	'messages:config-upload-deleted-help' => 'en:Choose a directory in which to archive deleted files.
Ideally, this should not be accessible from the web.',
	'messages:config-personalization-settings' => 'en:Personalization',
	'messages:config-logo-summary' => 'en:For each of these fields, you will need to upload an image of the appropriate size, and enter the URL in the boxes below. You can use <code>$wgStylePath</code> or <code>$wgScriptPath</code> if your logo is relative to those paths. You can leave any of these boxes blank.',
	'messages:config-logo-preview-main' => 'en:Main page',
	'messages:config-logo-icon' => 'en:Logo (icon):',
	'messages:config-logo-icon-help' => 'en:Your logo icon should be square and ideally more than 50px or an SVG.',
	'messages:config-logo-wordmark' => 'en:Wordmark (optional):',
	'messages:config-logo-wordmark-help' => 'en:The name of your site. If not defined, this will generally fall back to text. Ideally an SVG with height less than or equal to 30px.',
	'messages:config-logo-tagline' => 'en:Tagline (optional):',
	'messages:config-logo-tagline-help' => 'en:The tagline of your site. Use only if you have defined a wordmark above. If not defined, this will generally fall back to text. The combined height of the tagline and wordmark as a general rule should not exceed 50px.',
	'messages:config-logo-sidebar' => 'en:Sidebar logo (optional):',
	'messages:config-logo-filedrop' => 'en:Drop an image file here',
	'messages:config-logo-sidebar-help' => 'en:Some MediaWiki skins include a logo with 160 pixel height as part of the sidebar menu. If undefined, this is the same as the icon defined above. You may want to have a dedicated graphic that combines wordmark and icon.',
	'messages:config-instantcommons' => 'en:Enable Instant Commons',
	'messages:config-instantcommons-help' => 'en:[https://www.mediawiki.org/wiki/Special:MyLanguage/InstantCommons Instant Commons] is a feature that allows wikis to use images, sounds and other media found on the [https://commons.wikimedia.org/ Wikimedia Commons] site.
In order to do this, MediaWiki requires access to the Internet.

For more information on this feature, including instructions on how to set it up for wikis other than the Wikimedia Commons, consult [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgForeignFileRepos the manual].',
